import React, { Component } from 'react'
import { PageHeader, Input, List, Card, Space } from 'antd';
import { Link } from 'react-router-dom'
import './site.css'

const { Search } = Input
const data = [
    {
        title: 'Title 1',
    },
    {
        title: 'Title 2',
    },
    {
        title: 'Title 3',
    },
    {
        title: 'Title 4',
    },
];

export default class Site extends Component {

    onSearch = () => {
        console.log("search")
    }

    // onSearch = value => console.log(value);

    render() {
        return (
            <div>
                <PageHeader
                    title={<span style={{fontSize:'50px'}}>站点管理</span>}
                    subTitle={<Link to="/add" style={{ marginLeft: '20px' }}>新增</Link>}
                />
                <Search style={{ width: '300px' }} placeholder="名称、首字母、简拼" onSearch={this.onSearch} enterButton />
                <br />
                <br />
                <div>
                    <List className="site-list"
                        grid={{ gutter: 16, column: 4 }}
                        dataSource={data}
                        renderItem={item => (
                            <List.Item>
                                <Card style={{ textAlign: 'center' }}>成都</Card>
                            </List.Item>
                        )}
                    />
                </div>
            </div>
        )
    }
}
